    false,nt"url": null,nt"notes": "This narrative report for Pierce National
    Wildlife Refuge outlines Refuge accomplishments for the 1991 calendar year. The
    report begins by giving Refuge highlights and describing the climate and habitat
    conditions in the Refuge. Land acquisition is also covered. The planning section
    discusses personnel and compliance with environmental and cultural resource mandates.
    Administration topics are discusses, including personnel, funding, safety, and technical
    assistance. The habitat management section discusses wetlands, grasslands, grazing,
    pest control, water rights, erosion and contaminants. Wildlife- including wildlife
    diversity, endangered and threatened species, waterfowl, marsh and water birds,
    shorebirds, raptors, game mammals, other resident wildlife, and fisheries resources-
    are discussed. The public relations section discusses hunting and law enforcement.
    The construction and maintenance section describes rehabilitation, major maintenance,
    communications systems, computer systems, and energy conservation. Cooperative programs
    and items of interest are discussed. Photographs are attached.",nt"owner_org":
